import React from 'react';
import styled from 'styled-components';
import Header from '../../components/Header';
import ProductCard from '../../components/ProductCard';
import TheoImage from '../../images/per.webp'

const Page = styled.div`
  background-color: #eee;
  width: 100vw;
  padding: 0 0 30px;
`;

const lorem =
  'Especialidade corrida. Eu exercitation do est ea consequat mollit duis reprehenderit sit. Pariatur elit veniam sit eiusmod pariatur enim proident. Labore aliqua mollit sunt enim est id irure proident tempor commodo adipisicing amet.';

const products = [
  {
    image: TheoImage,
    title: 'Reinaldo',
    description: lorem,
    price: '80,00 hora'
  },
  {
    image: TheoImage,
    title: 'Cristiano',
    description: lorem,
    price: '65,50'
  },
  {
    image: TheoImage,
    title: 'Pedro',
    description: lorem,
    price: 'R$65,50/h'
  }
];



export default function Results(){
    return(
        <Page>
        <Header />
        {products.map((product) => {
          return (
            <ProductCard
              image={product.image}
              title={product.title}
              description={product.description}
              price={product.price}
            />
          );
        })}
      </Page>
    );

};
